import React, {Component} from 'react';

class MonsterEyes extends Component{

    constructor(props){
        super(props)
        this.state = { left:0, top:0, random:Math.random()}
    }

    render(){
        return (
            <div className="monster"  style={{left:this.props.width*this.state.random, top:(this.props.height-400)*this.state.random}} >
                <div className="monster_sprite"></div>
            </div>
        )
    }

}

export default MonsterEyes
